function Test() {

    useEffect(() => {
        fetchItems();
    },[]);

    const [movies, setMovies] = useState([])

    const fetchItems = async () => {
        let movie = 500
        const data = await fetch(`https://api.themoviedb.org/3/search/movie?api_key=19f2e6b52f112a3e330da1fe43fb0f9e&query=Step%20Brothers
        `)


        const movies = await data.json();
        console.log(movies)
        setMovies(movies)

    }

    return (
        <div>
            <h1>{movies.results[0].title}</h1>
        </div>
    )
}

export default Test;
